                    icon = ""fa-circle-o"";
                    break;
                case 1:
                    title = ""已轮到"";
                    icon = ""fa-dot-circle-o"";
                    break;
                case 2:
                    title = ""进行中"";
                    icon = ""fa-play-circle"";
                    break;
                case 3:
                    title = ""已完成"";
                    icon = ""fa-check-circle"";
                    break;
                case 4:
                    title = ""已停止"";
                    icon = ""fa-minus-circle"";
                    break;
            }
            return ""<i class=\""fa "" + icon + ""\"" style=\""font-size: 16px;\"" title=\"""" + title + ""\""></i>"";
        }

